import './CostForm.css';

function CostForm() {
  return (
    <form>
      <div className="costForm_items">
        <div className="costForm_item">
          <label className="costItem_Name">Название</label>
          <input className="costItem_Input" type="text" placeholder="Введите название" />
        </div>
        <div className="costForm_item">
          <label className="costItem_Name">Сумма</label>
          <input className="costItem_Input" type="number" min="1" step="1" max="999999" placeholder="Введите название" />
        </div>
        <div className="costForm_item">
          <label className="costItem_Name">Дата</label>
          <input className="costItem_Input" placeholder="Введите название" />
        </div>
      </div>
    </form>
  );
}

export default CostForm;
